import React from "react";
import logo from '../newtradr-logo.svg';

function HomePage() {
    return (
        <>
        <div className='Home'>
          <div className='HomePage-box'>
            <div className='HomePage-content'>
              <h2>Welcome, the Future of investing starts here!</h2>
            </div>
          </div>
        </div>
        </>
      );
}

export default HomePage;
